message:
Em breve os EUA anunciarão um novo pacote de ajuda militar à Ucrânia no valor de 1,1 bilhão de dólares

O pacote de ajuda incluirá:
📍Lançadores HIMARS;
📍Foguetes para HIMARS;
📍Sistemas de radar;
📍Meios de combate com drones;
📍Peças de reposição, treinamento e muito mais.

Ps. Logo os Orcs Zumbis Russos estarão atirando com arco e flecha🏹🏹

O cara gritou luladrão no meio do comício, simplesmente brabo.

